import React from "react";
import logo from "./mintbean.png";
import colorSelector from "/colorSelector";
var tinycolor = require("tinycolor2");

const headerStyle = {
  fontFamily: "sans-serif",
  fontSize: "50px",
  textAlign: "center",
  margin: "6rem 0",
};

function App() {
  return (
    <div>
      <h1 style={headerStyle}>Color Scheme Selector</h1>
      <colorSelector />
    </div>
  );
}

export default App;
